import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import '../components/styles/ListadoFotos.css';


function ListadoFotos(){

    return(
   
         <Row> 
             <Col md={4} lg={3} xs={12}>
             <Card>
                 <Card.Body>

                 <img src="https://cdn.pixabay.com/photo/2015/04/23/21/59/tree-736875__340.jpg" className="card-img-top"></img>
                 
                 <Card.Footer>$1232</Card.Footer>

                 </Card.Body>
             </Card>
             </Col>
         </Row>
       
    );
}

export default ListadoFotos;
